  <style>
    .app-loader-wrapper {
      position: fixed;
      top: 0;
      left: 0;
      right: 0;
      bottom: 0;
      z-index: 1100;
    }

    .app-loader {
      position: fixed;
      top: 50%;
      left: 50%;
      transform: translate(-50%, -50%) scale(0.8);
      display: flex;
      flex-direction: column;
      perspective: 900px;
    }

    .app-loader .top {
      position: relative;
      flex: 1 0 150px;
      width: 300px;
      transform-style: preserve-3d;
      transform: translateZ(-150px);
      animation: app-loader-rotation 8s ease-in-out infinite;
    }

    .app-loader .bottom {
      position: relative;
      flex: 1 0 150px;
      width: 300px;
      transform-style: preserve-3d;
      transform: translateZ(-150px);
      animation: app-loader-rotation 8s ease-in-out infinite reverse;
    }

    @keyframes app-loader-rotation {
      0% {
        transform: translateZ(-150px) rotateY(0deg);
      }

      20% {
        transform: translateZ(-150px) rotateY(-72deg);
      }

      40% {
        transform: translateZ(-150px) rotateY(-144deg);
      }

      60% {
        transform: translateZ(-150px) rotateY(-216deg);
      }

      80% {
        transform: translateZ(-150px) rotateY(-288deg);
      }

      100% {
        transform: translateZ(-150px) rotateY(-360deg);
      }
    }

    .app-loader .top svg {
      position: absolute;
      bottom: 0;
    }

    .app-loader .bottom svg {
      position: absolute;
      top: 0;
    }

    .app-loader svg {
      -webkit-backface-visibility: hidden;
      backface-visibility: hidden;
      height: 150px;
      width: 300px;
    }

    .app-loader svg:nth-of-type(1) {
      transform: rotateY(0deg) translateZ(150px);
    }

    .app-loader svg:nth-of-type(2) {
      transform: rotateY(72deg) translateZ(150px);
    }

    .app-loader svg:nth-of-type(3) {
      transform: rotateY(144deg) translateZ(150px);
    }

    .app-loader svg:nth-of-type(4) {
      transform: rotateY(216deg) translateZ(150px);
    }

    .app-loader svg:nth-of-type(5) {
      transform: rotateY(288deg) translateZ(150px);
    }
  </style>
</head>
